import React, { useState } from 'react';

const faqData = [
  {
    question: 'Î≥ëÏõê Ïö¥ÏòÅ ÏãúÍ∞ÑÏùÄ Ïñ¥ÎñªÍ≤å ÎêòÎÇòÏöî?',
    answer: 'ÌèâÏùº Ïò§Ï†Ñ 9ÏãúÎ∂ÄÌÑ∞ Ïò§ÌõÑ 6ÏãúÍπåÏßÄ Ïö¥ÏòÅÎê©ÎãàÎã§. (ÌÜ†/Ïùº/Í≥µÌú¥Ïùº Ìú¥Î¨¥ÏùºÏ†ïÏùÄ ÏÇ¨Ï†Ñ Í≥µÏßÄ Ï∞∏Í≥†)',
  },
  {
    question: 'Î≥ëÏõê ÏúÑÏπòÏôÄ Ï£ºÏ∞®Îäî Ïñ¥ÎñªÍ≤å ÌïòÎÇòÏöî?',
    answer: (
      <div>
        <p>Í≤ΩÍ∏∞ÎèÑ Í≥†ÏñëÏãú ÏùºÏÇ∞ÏÑúÍµ¨ Ï£ºÏóΩ2Îèô 115-2 (Ï£ºÌôîÎ°ú 88).<br />
        Ï£ºÏóΩÏó≠ 4Î≤à Ï∂úÍµ¨ÏóêÏÑú ÎèÑÎ≥¥ 3Î∂Ñ Í±∞Î¶¨Ïù¥Î©∞, Í±¥Î¨º ÎÇ¥ Ï£ºÏ∞® Í∞ÄÎä•Ìï©ÎãàÎã§.</p>
        <p style={{ marginTop: '6px' }}>
          <strong>ÏßÄÌïòÏ≤† Ïù¥Ïö©Ïãú:</strong> 3Ìò∏ÏÑ† Ï£ºÏóΩÏó≠ 4Î≤à Ï∂úÍµ¨ÏóêÏÑú ÏßÅÏßÑ 200m ÌõÑ ÎåÄÏö∞ÏãúÌã∞ÌîÑÎùºÏûê ÏôºÏ™Ω 50m<br />
          <strong>Î≤ÑÏä§ Ïù¥Ïö©Ïãú:</strong> 3Ìò∏ÏÑ† Ï£ºÏóΩÏó≠ Ï§ëÏïôÎ°ú Î≤ÑÏä§Ï†ïÎ•òÏû• ÌïòÏ∞® (Í∑∏ÎûúÎìúÎ∞±ÌôîÏ†ê Í±¥ÎÑàÌé∏)
        </p>
      </div>
    )
  },
  {
    question: 'ÏûÖÏõê Ï†àÏ∞®Îäî Ïñ¥ÎñªÍ≤å ÎêòÎÇòÏöî?',
    answer: 'Ïô∏Îûò ÏßÑÎ£å ÌõÑ ÏùòÎ£åÏßÑÏùò ÌåêÎã®Ïóê Îî∞Îùº ÏûÖÏõê Ïó¨Î∂ÄÍ∞Ä Í≤∞Ï†ïÎêòÎ©∞, ÏõêÎ¨¥Í≥ºÏóêÏÑú ÏûÖÏõê ÏàòÏÜçÏùÑ ÏßÑÌñâÌï©ÎãàÎã§.',
  },
  {
    question: 'ÏûÖÏõê ÎåÄÏÉÅÏù¥ Ïñ¥ÎñªÍ≤å Îê†ÍπåÏöî?',
    answer: (
      <div style={{ overflowX: 'auto' }}>
        <table style={{
          borderCollapse: 'collapse',
          width: '100%',
          fontSize: '14px',
          borderRadius: '8px',
          overflow: 'hidden'
        }}>
          <thead>
            <tr>
              <th style={tableTh}>ÎåÄÏÉÅ</th>
              <th style={tableTh}>ÏÑ§Î™Ö</th>
            </tr>
          </thead>
          <tbody>
            {[
              ['ÎÖ∏Ïù∏ÏÑ±ÏßàÌôòÏûê', 'ÏπòÎß§, Ï§ëÌíç, Í≥†ÌòàÏïï, ÎãπÎá®, Í¥ÄÏ†àÏóº, ÏúÑÍ∂§Ïñë Îì± ÎÖ∏Ïù∏ÏÑ± ÏßàÌôòÏùÑ Í≤™Í≥† Í≥ÑÏãúÎäî Î∂Ñ'],
              ['Ïã¨Ïû•ÏßàÌôòÏûê', 'Ïã¨Í∑ºÍ≤ΩÏÉâ, ÌòëÏã¨Ï¶ù, Ïã¨Î∂ÄÏ†Ñ, Î∂ÄÏ†ïÎß• Îì± Ïû•¬∑Îã®Í∏∞ ÏπòÎ£åÍ∞Ä ÌïÑÏöîÌïú Î∂Ñ'],
              ['Ìò∏Ìù°Í∏∞Í≥ÑÏßàÌôò', 'ÌèêÎ†¥, ÎßåÏÑ±ÌèêÏáÑÏÑ±ÌèêÏßàÌôò, Ï≤úÏãù Îì±ÏúºÎ°ú ÏöîÏñë ÏπòÎ£åÍ∞Ä ÌïÑÏöîÌïú Î∂Ñ'],
              ['Í∑ºÍ≥®Í≤©Í≥ÑÏßàÌôò', 'Ï≤ôÏ∂îÌòëÏ∞©, Í≥®Ï†à, Ìé∏ÎßàÎπÑ, ÏÇ¨ÏßÄÎßàÎπÑ Îì± Ïû¨Ìôú ÏπòÎ£åÍ∞Ä ÌïÑÏöîÌïú Î∂Ñ'],
              ['ÎáåÌòàÍ¥ÄÏßàÌôò', 'Ï§ëÌíç, ÌååÌÇ®Ïä®, ÏπòÎß§, ÎÖ∏Ïù∏ÏÑ±Ïö∞Ïö∏Ï¶ù Îì± Ïã†Í≤ΩÍ≥Ñ ÏßàÌôòÏûê'],
